import pyperclip

# Example multiline string
multiline_string = """data:image/gif;base64,"""

def convert_to_link(src_string, url):
    """
    Convert a source string to a clickable HTML link.

    :param src_string: The text to be displayed as the link.
    :param url: The URL to which the link should point.
    :return: An HTML string representing the clickable link.
    """
    return f'<a href="{url}">{src_string}</a>'

# Example usage
src_string = "Click to view image"
url = multiline_string
html_link = convert_to_link(src_string, url)

print(html_link)
